import Navbar from './components/Navbar';
import React from "react";
import './App.css';
import { BrowserRouter as Link } from 'react-router-dom';

function App() {
  return (
    <div className="Page">
    <div className="App">
      <Link to="/">
        <h1>Race Organization</h1>
      </Link>
      <Navbar />
    </div>
    </div>
  );
}

export default App;
